        props.onAddExpense(expenseData)
        console.log(expenseData)
    }

    const content = isEditingForm ? <div className="new-expense">
    <ExpenseForm onSaveExpenseData={saveExpenseDataHandler}/>
</div> : <div className="new-expense"><button>Add new expense</button></div>
